import { useState } from 'react';
import Layout from '../../components/Layout';
import Date_FreeText from '../../components/Date_FreeText';
import Date_Calendar from '../../components/Date_Calendar';

export default ({query}) => {
	const [whichSection, setWhichSection] = useState(1);

	const y = e => {
		setWhichSection(parseInt(e.target.id));
	};
	
	console.log(query)

	return (
		<Layout>
			<br />
			<br />
			<p className="title has-text-link has-text-centered has-text-weight-normal">Choose your dates</p>
			<div className="columns has-text-centered">
				<div className="column"></div>
				<div className="column is-4 has-background-white-ter">
					<a className="btn" onClick={y} id="0">
						calendar
					</a>
				</div>
				<div className="column is-4 has-background-white-ter">
					<a className="btn" onClick={y} id="1">
						free text
					</a>
				</div>
				<div className="column"></div>
			</div>
			<div>{whichSection === 0 ? <Date_Calendar /> : <Date_FreeText />}</div>
		</Layout>
	);
};
